            "text" : "- 50’ or 60’ is when Synthetic Telepathy (analog version) probably started to be used. It may or may not have been developed for US DoD or could also have come from a university spin-off or private R&D company back then. I call this organization #ATG (Ancestral Task Group, GTA in French). \nThis organization also started using this tech for a specific political agenda. This was originally well intended though misguided. After WW2 and the use of nuclear weapons in Hiroshima and Nagasaki they wanted to get a grib on this and other potential “dangerous new discoveries and applications” as mankind was deemed not ready, lacking the wisdom, to use knowledge well.\nATG became an oraganization that is able to monitor scientific developments and application through telepathic infiltration.",
