            "data" : { },
            "text" : "- 60-80' ATG started to do some other work for the private sector. This led some of people of this hidden organization to also use this for selfish personal gain. Ideal for stealing secrets and learning damaging things about the wealthy and also large organizations. Plain extortion and blackmail became the result. The fact that all of this went on in secret without much hope for the victims to ever get concrete evidence meant this criminal/maffia activity brought unseen illegal gains from black-mail. I call this (even more) corrupt faction of ATG simply the \"Department of Maffia\" or DoM. ",
