            "text" : "- 84' Launch of new version of synthetic telepathy that now ran on Aritificial Intelligence #AI. I talked here on twitter about what I call \"SuperAI mind-sync\" A global IT network was also rolled out to allow this to be used anywhere on anyone laying the infrastructure foundation for deployment on the entire human population of our planet. The cold war was still happening so countries like China and Russia did not get this tech. ",
