            "text" : "- handshake\n- malicious bad people versus well good people with intentions \n- use with influencers??\n- nudging\n- superAI mind-sync\n- how DoM was deceived by the engineers of superAI mindsync to eliminat corruption in ATG\n- use of psyho manip - vb weapanized pyschopats - brainwash - maint conditiongn \n- parallel cyberbullying + designer malware \n- people die? who? how many?\n- erasing of traces on the internet of victims\n- what is the end-goal: fascism? DoM becomes anarchy and tech dark ages?",
