            "text" : "Knowing some of the abuse is coming from former colleagues here in Belgium  it is hard for me not to feel even more desparate. How could they, where are the people I used to know and like. The excesses here in BE are horrible. They seem to have enough lee way within ATG for non-standard automation of abuse. This leads to even worse abuse that is already inhumane to the extreme and still getting worse.",
