            "data" : { },
            "text" : "If this is not stopped the combination of DoM and ATG's plan now for a new world order (probably fascist?) is sure to fail though they will never belive it until it is too late. These 2 factions within ATG can only get along while they have a common enemy, or a common goal: world domination. Once this would be achieved they will fight oneanother. This means anarchy.  ",
