            "text" : "You welke rechten die in de belgische grondwet staan kunnen door de pandemiewet tijdelijk worden opgeheven? Copilot De pandemiewet in België geeft de overheid de mogelijkheid om bepaalde grondrechten tijdelijk te beperken tijdens een epidemische noodsituatie. Enkele van de rechten die tijdelijk kunnen worden beperkt zijn:",
