            "text" : "Vrijheid van beweging: Beperkingen op reizen en verplaatsingen om de verspreiding van het virus te beperken. Vrijheid van vergadering: Verboden of beperkingen op bijeenkomsten en evenementen. Recht op privacy: Verzameling en verwerking van persoonlijke gezondheidsgegevens voor contactopsporing en monitoring. Vrijheid van ondernemen: Sluiting of beperking van bepaalde bedrijven en economische activiteiten. Onderwijsrechten: Sluiting van scholen en universiteiten of overgang naar online onderwijs. Deze maatregelen moeten altijd proportioneel zijn, strikt noodzakelijk en in de tijd beperkt123.",
