            "text" : "bing.com +6 more You Is de pandemiewet in strijd met de grondwet? Copilot Het Grondwettelijk Hof van België heeft geoordeeld dat de pandemiewet niet in strijd is met de grondwet12. De pandemiewet biedt een juridische basis voor het nemen van maatregelen tijdens een epidemische noodsituatie en is ontworpen om een evenwicht te vinden tussen de bescherming van de volksgezondheid en de grondrechten van burgers1.",
