            "text" : "wolterskluwer.com You waarom is de pandemiewet dan niet toegevoegd als een extra grondwetsartikel? Copilot De pandemiewet is niet toegevoegd als een extra grondwetsartikel om verschillende redenen:",
            "key" : "1lgnr",
