            "text" : "Artikel 15: Dit artikel beschermt de onschendbaarheid van de woning, maar maakt uitzonderingen mogelijk in gevallen die bij wet zijn bepaald, zoals noodsituaties. Artikel 22: Dit artikel beschermt het recht op privacy, maar staat beperkingen toe in het kader van de bescherming van de volksgezondheid. Artikel 23: Dit artikel garandeert het recht op een gezond leefmilieu en de bescherming van de gezondheid, wat de basis kan vormen voor maatregelen tijdens een pandemie. Artikel 105: Dit artikel geeft de Koning de bevoegdheid om in uitzonderlijke omstandigheden maatregelen te nemen die noodzakelijk zijn voor de openbare orde en veiligheid. Artikel 108: Dit artikel geeft de Koning de bevoegdheid om de wetten uit te voeren en de nodige maatregelen te nemen om de uitvoering ervan te verzekeren. Deze artikelen bieden de grondwettelijke basis voor het nemen van maatregelen die nodig zijn om de volksgezondheid te beschermen en noodsituaties te beheersen123.",
