            "text" : "belgischegrondwet.be You is het de koning zelf die in artikel 105 beslist als staatshoofd of is dit de regering? Copilot In België is het de regering die de uitvoerende macht uitoefent, hoewel de Koning formeel de besluiten ondertekent. Artikel 105 van de Belgische Grondwet stelt dat de Koning geen andere macht heeft dan die welke de Grondwet en de bijzondere wetten hem uitdrukkelijk toekennen1. In de praktijk betekent dit dat de Koning handelt op advies en met instemming van de ministers. De regering, geleid door de Eerste Minister, neemt de beslissingen en is verantwoordelijk voor de uitvoering van de wetten en het beheer van de staat23.",
